export default function Comptest({size,name,nmclass,H1,logo1,text,prix}) {
return (
    <div className="Comptest">
        <h1>{H1}</h1>
        <img
        src={logo1}
        alt={name}
        className={nmclass}
        width={size.width}
        height={size.height}/>
        <p>Description: {text}<br/>
        Price: {prix}</p>
    </div> );
}
